    [],nt"revision_timestamp": "2015-11-20T22:44:24.122014",nt"name": "ejscreen-states-percentiles-lookup-table-2015-public-release",nt"isopen":
    false,nt"url": null,nt"notes": "The States table provides percentile breaks
    of important EJSCREEN elements (demographic indicators and indexes, environmental
    indicators and indexes) at the state summary level. This table provides support
    to the EJSCREEN reporting tools. EJSCREEN is an environmental justice (EJ) screening
    and mapping tool that provides EPA with a nationally consistent dataset and methodology
    for calculating "EJ indexes," which can be used for highlighting places that may
    be candidates for further review, analysis, or outreach as the agency develops programs,
    policies and other activities. The National-scale Air Toxics Assessment (NATA) environmental
    indicators and EJ indexes, which include cancer risk, respiratory hazard, neurodevelopment
    hazard, and diesel particulate matter will be added into EJSCREEN during the first
    full public update after the soon-to-be-released 2011 dataset is made available.
    All NATA associated indicator and index elements are currently set to "Null".",nt"license_title":
